import React, { useState, useEffect } from 'react';
import { fetchNews } from '../services/NewService'; // Make sure the path is correct
import SearchBar from './SearchBar';
import '../../src/App.css'; // Ensure this path is correct
import axios from 'axios';

const NewsList = () => {
    const [newsItems, setNewsItems] = useState([]);
    const [filteredItems, setFilteredItems] = useState([]);
    const [searchTerm, setSearchTerm] = useState('');
    const [showDialog, setShowDialog] = useState(false);
    const [generatedPost, setGeneratedPost] = useState('');

    useEffect(() => {
        const loadData = async () => {
            try {
                const data = await fetchNews(); // No need to adjust parameters
                console.log("Fetched data:", data); // Log the response data
                setNewsItems(data); // Assuming 'data' is the array of news items
                setFilteredItems(data); // Set filtered items to the full list initially
            } catch (error) {
                console.error("Error fetching news:", error);
            }
        };

        loadData();
    }, []);

    const handleSearch = () => {
        const filtered = newsItems.filter(item =>
            item.title?.toLowerCase().includes(searchTerm.toLowerCase())
        );
        setFilteredItems(filtered);
    };

    const handleClear = () => {
        setFilteredItems(newsItems);
        setSearchTerm('');
    };

    const handleGenerateClick = async (newsItem) => {
        try {
            const response = await axios.post('http://127.0.0.1:8000/generate-social-post', {
                title: newsItem.title,
                description: newsItem.description // Adjust these fields based on your actual data structure
            });
            setGeneratedPost(response.data.generated_post);
            setShowDialog(true);
        } catch (error) {
            console.error("Error generating social media post:", error);
        }
    };
    return (
        <div>
            <SearchBar 
                searchTerm={searchTerm} 
                setSearchTerm={setSearchTerm} 
                onSearch={handleSearch} 
                onClear={handleClear} 
            />
            <table className="news-table">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Category</th>
                        <th>Title</th>
                        <th>Link</th>
                        <th>Image</th>
                        <th>Date/Time</th>
                        <th>Actions</th> {/* New column for actions */}

                    </tr>
                </thead>
                <tbody>
                    {filteredItems.map(item => (
                        <tr key={item.id}>
                            <td>{item.id}</td>
                            <td>{item.category}</td>
                            <td>{item.title}</td>
                            <td>
                                {item.link ? <a href={item.link} target="_blank" rel="noreferrer">Link</a> : 'N/A'}
                            </td>
                            <td>
                                {item.image ? <img src={item.image} alt={item.title} style={{ width: '100px' }} /> : 'No Image'}
                            </td>
                            <td>{item.datetime_utc}
                            </td>
                            <td>
                                <button onClick={() => handleGenerateClick(item)}>Generate</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
            {showDialog && (
                <div className="dialog">
                    <h3>Generated Social Media Post</h3>
                    <p>{generatedPost}</p>
                    <button onClick={() => setShowDialog(false)}>Close</button>
                </div>
            )}
        </div>
    );
};

export default NewsList;
